import React from "react";
import {NavLink} from "react-router-dom";
const Navbar = () => {
  return (
    <>
  
  <nav>
        <div className="navbar h-nav ">
            <ul className="nav-list v-class ">

                {/* <img src="./images/IMG_20210329_205312_237.jpg" alt=""/> */}
                <NavLink   ActiveClassName="active " to="/">Home </NavLink>
                <NavLink   ActiveClassName="active " to="/about">About us </NavLink>
                <NavLink   ActiveClassName="active " to="/video">Videos</NavLink>
                <NavLink   ActiveClassName="active " to="/gallery">Gallery </NavLink>
                <NavLink   ActiveClassName="active " to="/service">Services </NavLink>
                <NavLink   ActiveClassName="active " to="/contact">Contact us </NavLink>


                <div className="right-nav ">
                    <input type="text" placeholder="Search.."/>
                    <button className="btn-bg">Search</button>
                    <button className="btn-bg2">Login</button>
                    <button className="btn-bg2">SignUp</button>
                </div>
            </ul>
            <div className="burger">
                <div className="line"></div>
                <div className="line"></div>
                <div className="line"></div>
            </div>



        </div>
    </nav>
    </>
  );
};
export default Navbar;
